import styled from "@emotion/styled";

export const Layout = styled.div`
  display: flex;
`;

export const LayoutContent = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  margin: 0 auto;
  box-sizing: border-box;
  max-width: 1360px;

  & > div {
    display: flex;
    flex-wrap: wrap;
  }
`;
